import styled from "styled-components";

const Wrapper = styled.div`
font-size: 10px;
    display: flex;
    flex: 0 1 24%;
    align-items: center;
    height: 100px;
    width: 100%;
    border: 2px solid black;
    justify-content: center;
    margin-top: 6px;
    box-shadow: 
    border-radius: 5px;
    box-shadow: -20px 30px 116px 0 rgba(92, 15, 15, 0.54);
    z-index: 1;
`;

const Card = ({ onDragStart = undefined, draggable = false, children }) => {

    return (
        <Wrapper onDragStart={onDragStart} draggable={draggable}>
            {children}
        </Wrapper>
    );
};

export default Card;
